import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';


let postsData = [
    {id: 1, message: 'Hi, my friend!', likesCount: 11},
    {id: 2, message: 'My first post', likesCount: 12},
];
let dialogsData = [
    {id: 1, name: 'Alex'},
    {id: 2, name: 'Vasile'},
    {id: 3, name: 'Michael'},
    {id: 4, name: 'Any'},
    {id: 5, name: 'Anna'}
];

let messagesData = [
    {id: 1, message: 'Hi Alex'},
    {id: 2, message: 'Hi Vasile'},
    {id: 3, message: 'Hello dear Michael'},
    {id: 4, message: 'hi my sister Any'},
    {id: 5, message: 'Yo, how are you Anna'}
]

ReactDOM.render(
    <App posts={postsData} dialogs={dialogsData} messages={messagesData}/>,
  document.getElementById('root')
);
